import React from 'react';
import './GoToApplication.css';

function GoToApplication() {
  const handleFloorClick = (floor) => {
    const spaces = document.querySelectorAll('.space');
    spaces.forEach((space) => {
      space.classList.remove('show');
    });

    const selectedSpaces = document.querySelectorAll(`.space[data-floor="${floor}"]`);
    selectedSpaces.forEach((space) => {
      space.classList.add('show');
    });
  };

  return (
    <div className="container">
      <div className="header">
        <h1>공간을 선택하세요</h1>
      </div>
      <div className="floors">
        <div className="floor">
          <button className="floor-button" data-floor="3" onClick={() => handleFloorClick('3')}>
            3층<br />실내 활동 공간 (스스)
          </button>
        </div>
        <div className="floor">
          <button className="floor-button" data-floor="2" onClick={() => handleFloorClick('2')}>
            2층<br />게임 공간
          </button>
        </div>
        <div className="floor">
          <button className="floor-button" data-floor="1" onClick={() => handleFloorClick('1')}>
            1층<br />표현 공간
          </button>
        </div>
        <div className="floor">
          <button className="floor-button" data-floor="B1" onClick={() => handleFloorClick('B1')}>
            B1층<br />문화 공간
          </button>
        </div>
      </div>
      <div className="spaces">
        <div className="space" data-floor="3">
          <button className="space-button">스스</button>
        </div>
        <div className="space" data-floor="2">
          <button className="space-button">PC01</button>
          <button className="space-button">PC02</button>
          <button className="space-button">PC03</button>
          <button className="space-button">PC00</button>
          <button className="space-button">POOT</button>
          <button className="space-button">1008</button>
          <button className="space-button">POI</button>
        </div>
        <div className="space" data-floor="1">
          <button className="space-button">표현 공간</button>
          <button className="space-button">모둠 공간</button>
        </div>
        <div className="space" data-floor="B1">
          <button className="space-button">Play.Pass</button>
        </div>
      </div>
      <div className="footer">
        <p>2024-06-24 (월)</p>
        <p>오후에 메인 화면으로 이동합니다.</p>
        <p>11:50:49</p>
      </div>
    </div>
  );
}

export default GoToApplication;
